public class ModelQualityJobDefinitionFactory(string resourceName = null, Action<Humidifier.SageMaker.ModelQualityJobDefinition> factoryAction = null) : ResourceFactory<Humidifier.SageMaker.ModelQualityJobDefinition>(resourceName)
{

    internal InnerModelQualityJobDefinitionModelQualityAppSpecificationFactory ModelQualityAppSpecificationFactory { get; set; }

    internal InnerModelQualityJobDefinitionStoppingConditionFactory StoppingConditionFactory { get; set; }

    internal InnerModelQualityJobDefinitionModelQualityBaselineConfigFactory ModelQualityBaselineConfigFactory { get; set; }

    internal InnerModelQualityJobDefinitionModelQualityJobInputFactory ModelQualityJobInputFactory { get; set; }

    internal InnerModelQualityJobDefinitionMonitoringResourcesFactory JobResourcesFactory { get; set; }

    internal InnerModelQualityJobDefinitionNetworkConfigFactory NetworkConfigFactory { get; set; }

    internal InnerModelQualityJobDefinitionMonitoringOutputConfigFactory ModelQualityJobOutputConfigFactory { get; set; }

    protected override Humidifier.SageMaker.ModelQualityJobDefinition Create()
    {
        var modelQualityJobDefinitionResult = CreateModelQualityJobDefinition();
        factoryAction?.Invoke(modelQualityJobDefinitionResult);

        return modelQualityJobDefinitionResult;
    }

    private Humidifier.SageMaker.ModelQualityJobDefinition CreateModelQualityJobDefinition()
    {
        var modelQualityJobDefinitionResult = new Humidifier.SageMaker.ModelQualityJobDefinition
        {
            GivenName = InputResourceName,
        };

        return modelQualityJobDefinitionResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.ModelQualityJobDefinition result)
    {
        base.CreateChildren(result);

        result.ModelQualityAppSpecification ??= ModelQualityAppSpecificationFactory?.Build();
        result.StoppingCondition ??= StoppingConditionFactory?.Build();
        result.ModelQualityBaselineConfig ??= ModelQualityBaselineConfigFactory?.Build();
        result.ModelQualityJobInput ??= ModelQualityJobInputFactory?.Build();
        result.JobResources ??= JobResourcesFactory?.Build();
        result.NetworkConfig ??= NetworkConfigFactory?.Build();
        result.ModelQualityJobOutputConfig ??= ModelQualityJobOutputConfigFactory?.Build();
    }

} // End Of Class

